module.exports = JSON.parse('{"termsMarketing":{"ko":"㈜에이스트릭트스튜디오(이하 ‘회사’)의 ARTE NFT 서비스(이하 ‘서비스’)는 회원에게 보다 다양한 정보를 제공하고, 서비스의 질을 향상시키기 위해 회원이 수집 및 이용에 동의한 개인정보를 활용하여 상품 소개 및 홍보 등 영업 목적으로 제공할 수 있습니다.  \\n 개인정보보호법 제22조 제4항에 의해 마케팅 정보 수신 여부 및 마케팅을 위한 개인정보 수집 이용을 거부하실 수 있으며, 거부 시에도 서비스를 이용하실 수 있으나, 동의를 거부한 경우 각종 소식 및 이벤트 참여에 제한이 있을 수 있습니다. \\n \\n 제1조 (개인정보 수집 항목) \\n\\n 1. 이름 \\n 2. 휴대폰번호 \\n 3. 이메일주소 \\n 4. 주소 \\n \\n 제2조 (개인정보 수집 이용 목적) \\n \\n 제공된 정보의 이용 목적은 아래와 같습니다. \\n1. 서비스 관련 정보(신규 기능 개발 및 맞춤 서비스 제공) \\n 2. 할인, 쿠폰, 및 이벤트 등 광고성 정보 제공 \\n 3. 서비스의 유효성 확인 및 기타 서비스 개선을 위한 활동 등 정보 제공된 정보는 명시된 이용목적을 벗어나 이용되지 않고, 개인정보의 유출 등 사고가 일어나지 않도록 철저한 보안이 이루어지도록 노력하고 있습니다. \\n \\n 제3조 (보유 및 이용기간) \\n \\n 제공된 정보는 회원이 동의를 철회할 때까지 보유·이용합니다. \\n 회원은 언제든지 열람, 정정, 삭제를 요구할 수 있습니다. 열람, 정정, 삭제 및 정보제공 등의 철회는 문의 메일을 통하여 요청할 수 있습니다. \\n 이미 제공된 회원정보를 철회하는 데는 최대 10일의 기간이 소요됩니다. \\n 활용 동의 철회를 요청하시더라도 위와 같은 이유로 해당 철회 적용 이전까지 마케팅에 활용될 수 있음을 알려드립니다. \\n \\n- 공고 일자 : 2023년 4월 30일 \\n- 시행 일자 : 2023년 5월 30일","en":"ARTE NFT Service (hereinafter referred to as “Service) provided by a’strict Studio Co., Ltd. (hereinafter referred to as “Company”) can provide additional information in order to improve the quality of services by sending product information and promotion or marketing information for business purposes to Users, using the provided personal information the Users agreed to. According to Article 22 (4) of the Personal Information Protection Act, User can refuse the collection and use of personal information for marketing purposes and can refuse to receive marketing information. Even if User does not consent, he or she will be able to use the Service, but there may be restrictions on participation in various news and events. \\n\\nArticle 1. Collected Personal Information\\n 1.\\t Name\\n  2. Phone Number\\n 3.\\tEmail Address\\n 4.\\tShipping Address\\n\\nArticle 2. Use of the Collected Personal Information\\nThe Company uses the provided personal information for following purposes:\\n \\t1. Provide service-related information (development of new functions and provision of customized services)\\n \\t2. Provide marketing promotional information, such as discounts, coupons and events.\\n \\t3. Provide information regarding service validation and other activities for service improvement\\nThe provided information will not be used other than the above stated purpose of use and the Company tries to ensure secure protection of personal information to prevent accidents, such as leakage of information.\\n\\nArticle 3. Use and Retention of Personal Information\\nThe provided information will be destroyed without delay once the purpose of use has been achieved. Users may request to view, correct or delete them at any time. Withdrawal of personal information, such as their browsing, correction or deletion, can be requested through email inquiry. It may take up to 10 days for the withdrawal of provided personal information. Even if the User request withdrawal of the consent for use, it can be used for marketing purposes before the withdrawal process is complete. \\n\\n- Notification Date: Feb 9, 2023\\n- Effective Date: Feb 23, 2023\\n"},"termsService":{"ko":"제1조 (목적) \\n 이용자(이하 “회원”)가 주식회사 에이스트릭트스튜디오(이하 “회사”)가 제공하는 ARTE NFT서비스(이하 “서비스”)를 이용함에 있어 회사와 회원의 권리, 의무 및 책임 사항을 규정함을 목적으로 합니다. \\n \\n 제2조 (용어의 정의) \\n 이 약관에서 사용하는 용어의 정의는 다음 각호와 같으며, 정의되지 않은 용어에 대한 해석은 관계 법령과 회사의 이용약관 및 개인정보처리방침, 회사가 별도로 정한 지침 등의 상관례에 의합니다. \\n 1. “서비스”라 함은 회사가 웹과 모바일 환경에서 제공하는 서비스 및 관련 제반 서비스를 의미합니다. \\n 2. “회원”이라 함은 회사의 “서비스”에 접속하여 본 약관에 동의한 후 “회사”가 제공하는 “서비스”를 이용하는 고객을 말합니다. \\n 3. “계정”이라 함은 회원이 본 약관에 동의한 후 입력한 가상 지갑 주소를 말합니다. \\n 4. “NFT”란 대체 불가능한 토큰(Non-Fungible Token)으로서, (i) 이미지, 동영상, 음악, 서적 등의 “디지털 저작물”에 대한 메타데이터 정보를 포함한 상태로 발행되어, (ii) 해당 NFT 소유자에게 상기 “디지털 저작물”에 관한 특정 권리 (이하 “NFT 소유자의 권리”)가 부여되는 블록체인 기반의 디지털 자산을 의미합니다. \\n 5. “디지털 저작물”이란, NFT에 연계된 디지털 이미지, 동영상, 음악, 서적 등의 디지털 저작물을 의미합니다. \\n 6. “가상 지갑”이란, 이더리움 기반 가상 자산 지갑 서비스인 메타마스크 지갑을 의미합니다. \\n 7. “스마트 컨트랙트”란, NFT 작품의 생성, 판매를 포함하여 전반적인 정보를 포함하고 있으며 ARTE NFT의 블록 체인망인 이더리움 메인 넷 환경 위에서 동작 가능한 언어로 작성된 코드 모음을 말합니다. \\n 8. “NFT 소유자의 권리”란, NFT가 ARTE NFT에서 최초로 판매되는 시점에 고지된 권리를 의미합니다. “NFT 소유자의 권리”는 NFT에 연계된 “디지털 저작물”을 일정 한도 내에서 이용할 수 있는 권한을 의미할 뿐 “디지털 저작물” 자체에 대한 소유권, 저작권을 포함한 지식 재산권, 기타 권리를 취득하는 것을 의미하는 것은 아닙니다. 각 NFT 별로 “NFT 소유자의 권리”의 내용은 다를 수 있습니다. \\n 9.  “ARTE NFT” 서비스란 ㈜에이스트릭트스튜디오의 ARTE MUSEUM의 작품을 활용해 디지털 형태의 NFT 상품으로 판매하는 서비스를 말합니다. \\n 10. “ARTE HOME” 서비스란 ARTE NFT를 보유하고 있는 자가 디지털 파일 형태가 아닌 액자와 디지털 디스플레이와 같은 실물 형태의 상품을 구매할 수 있는 서비스를 의미합니다. \\n \\n 제3조 (약관의 개시와 개정) \\n 1. \\"회사\\"는 이 약관의 내용을 \\"회원\\"이 쉽게 알 수 있도록 웹페이지 초기 화면에 게시합니다 \\n 2. “회사”는 필요한 경우 관련 법령을 위배하지 않는 범위에서 이 약관을 개정할 수 있습니다. \\n \\n 제4조 (약관의 해석) \\n 1. “회사”는 이 약관 외에 별도의 운영정책을 둘 수 있습니다. \\n 2. 이 약관에서 정하지 않은 사항이나 해석에 대해서는 웹페이지에 별도로 규정하는 바를 따릅니다. \\n \\n 제5조 (NFT 소유자의 권리) \\n 1. NFT를 구매하거나 소유권을 취득하는 경우, “사용자”는 본 이용약관에 따라 NFT의 소유권을 판매, 양도, 기부 또는 기타 방법으로 처분할 권리를 취득합니다. “회원”은 NFT와 관련되거나 NFT에 포함되는 작품, 이미지, 음악, 멀티미디어 작품 또는 기타 콘텐츠(이하 “아트”)에 대한 어떠한 권리나 소유권도 취득하지 않으며, 특히 “회원”의 아트 사용 권한은 본 이용약관 제5조 제2항에 따릅니다. \\n 2. 다음의 모든 권리 및 소유권은 관련 법률에 따라 “회사”가 소유합니다: (a) 상표, 서비스 마크, 상호, 로고, 도메인 이름; (b) (저작권의 존재 여부에 상관 없이) 저작권, 및 저작권과 관련된 모든 기타 권리; (c) 산업 디자인권; (d) 초상권; (e) 등록 여부에 상관 없이 기타 모든 지식재산권 및 독점권에 대한 등록 , 신청, 갱신, 또는 연장할 수 있는 권리 (이하 “회사 IP”). “회원”은 회사 IP에 대해서 비전속적, 비영리로 사용할 수 있는 권한을 가지고, “회원”은 본 이용약관상 라이선스 허용범위를 벗어나 회사 IP의 내용에 반하는 어떠한 행위도 하지 않는다는 것에 동의하며(이하 “라이선스 제한”) ”회사”는 회사 IP(및 회사 IP의 모든 구성 요소)를 등록하고 소유할 수 있는 독점적인 권리를 보유하고, 회사 IP와 관련된 모든 침해, 도용, 또는 불공정 경쟁에 대해 소송을 제기할 수 있습니다. 만약 “회원”이 법적인 절차 또는 기타 방법을 통해 회사 IP에 대한 권리를 취득할 경우, “회원”은 취득한 권리를 “회사” 또는 “회원”에 의한 추가적인 조치 없이 “회사”에 양도합니다. \\n 3. NFT를 보유한 자는 NFT와 연계된 디지털 저작물을 원본을 수정할 권한이 없고, 디지털 저작물을 그대로 개인적이고 비상업적으로만 이용할 수 있습니다. \\n 4. “NFT 소유자의 권리”는 NFT를 적법하게 보유하고 있는 동안에만 행사할 수 있으며, “NFT 소유자의 권리”는 권리를 행사하는 시점에 해당 NFT를 보유한 자에게 인정됩니다. 타인에게 NFT를 이전한 경우, NFT를 양도한 회원은 “NFT 소유자의 권리”를 더 이상 행사할 수 없습니다. “회사”가 공식적으로 지원하는 방식이 아닌 방식 및/또는 관련 법령을 위반하는 방식으로 NFT를 이전 받은 자에게는 “NFT 소유자의 권리”가 보장되지 않을 수 있습니다. \\n \\n 제6조 (NFT 서비스의 이용) \\n 1. ARTE NFT 서비스는 메타마스크 지갑 서비스와 연동되어 제공되는 서비스로, 메타마스크 지갑 등록을 거친 회원에 한하여 사용할 수 있습니다. ARTE NFT 서비스와 관련하여 가상 지갑을 사용함으로써 귀하는 해당 지갑 공급자의 약관에 따라 지갑을 사용하는데 동의합니다. 가상 지갑은 ARTE NFT에 의해 운영되거나 유지되지 않으며, ARTE NFT는 지갑의 내용에 대한 보관이나 통제권을 가지고 있지 않으며 지갑의 내용물을 검색하거나 이전할 수 없습니다. 본 조의 규정은 NFT 거래 서비스의 내용과 제한에 대해 기술합니다. 회원은 회사가 공지한 사항을 사전에 충분히 이해하고 서비스를 이용하여야 합니다. 회사는 회원이 관련 사항을 충분히 숙지하지 아니하여 발생하는 문제에 대해서는 회사의 고의 또는 과실이 없는 한 어떠한 책임도 지지 않습니다. \\n 2. NFT 구매 서비스 \\n 가. 만약 동일한 ARTE NFT 상품에 동시에 구매신청이 생길 경우, 상품은 가장 먼저 구매를 신청한 구매자에게 제공됩니다. \\n 나. 회원이 구매자로서 행한 거래가 완료된 경우 철회가 불가합니다. 이는 회원의 과실로 구매한 경우에도 동일합니다. \\n 3. NFT 결제 서비스 \\n 가. 회사는 NFT 거래 시 NFT의 수령, 임시 보관 등을 포함하여 원화 결제 서비스(이하 “일반 결제”)와 디지털 자산 결제 서비스를 제공합니다. 본 서비스 내의 일반결제 란 ㈜ 다날 결제 서비스 중 계좌이체, 휴대폰 결제, 상품권 결제를 의미하며 디지털 자산 결제 서비스는 가상화폐 이더리움을 의미합니다.\\n 나. 회사는 ARTE HOME 서비스 내 실물 상품 거래 시, 일반 결제 서비스를 제공합니다. 본 서비스 내의 일반 결제 서비스는 ㈜ 다날 결제 서비스 중 신용카드, 계좌이체, 휴대폰 결제, 상품권 결제를 의미합니다. \\n 다. 회사는 회원이 정한 조건으로 NFT 거래와 거래 금액에 따른 거래의 실행을 지원하는 것이므로 구매자를 대리, 대행하거나 그 이행을 보조하는 것은 아닙니다. 또한 디지털 자산 결제 서비스와 원화 결제 시스템과 관련하여 회사는 이에 관한 권한이 전혀 없고, 이는 결제 시스템 서비스 제공자의 서비스로서 회사가 제공하는 서비스가 아닙니다. \\n 라. 회원은 원화 결제 시, 거래 화면에 표기되어 있는 가상화폐 금액을 인지하고 구매 가격의 유동성에 대해 완전히 숙지하고 거래에 참여해야 합니다. \\n 마. 회원은 원화 결제수단을 사용함에 있어 반드시 본인 명의의 결제 수단을 사용하여야 하며, 타인의 결제 수단을 임의로 사용하여서는 안 됩니다. 타인의 결제 수단을 임의 사용함으로써 발생하는 회사, 결제수단의 적법한 소유자, 결제 관련 제3자의 손실과 손해에 대한 책임은 회원에게 있습니다. \\n 바. 결제와 관련하여 회원이 입력한 정보 및 그 정보와 관련하여 발생한 책임과 불이익은 회원이 부담하여야 합니다. \\n 사. 회사는 회원이 사용하는 결제수단에 대하여 정당한 사용 권한이 있는지 확인할 수 있고, 이에 대한 확인이 완료될 때까지 해당 거래의 진행을 중지하거나 해당 거래를 취소할 수 있습니다. \\n 아. 회사가 제공하는 결제 서비스를 이용하지 않은 거래에 대해 회사는 일체의 책임을 지지 않습니다.\\n \\n 제7조 (서비스의 변경 및 제한) \\n 1. 회사는 서비스의 향상을 위하여 서비스의 전부 또는 일부 내용을 변경할 수 있습니다. \\n 2. 회사는 다음 각 호의 어느 하나에 해당하는 경우 서비스의 전부 또는 일부를 제한하거나 중단할 수 있습니다. \\n 가. 컴퓨터 등 정보통신 설비의 보수점검·교체 및 고장, 통신의 두절 등의 사유가 발생한 경우 \\n 나. 서비스를 위한 설비의 보수 등 공사로 인해 부득이한 경우 \\n 다. 정전, 제반 설비의 장애 또는 서비스 이용의 폭주 등으로 정상적인 서비스 이용에 지장이 있는 경우 \\n 라. 회원이 회사의 영업활동에 방해하는 경우 \\n 마. 서비스 제공업자와의 계약 종료, 경영상의 판단 등과 같은 회사의 제반 사정으로 서비스를 유지할 수 없는 경우 \\n 바. 기타 천재지변, 국가비상사태 등 불가항력적 사유가 있는 경우 \\n 사. 회사의 사업 계획의 변경 또는 경영상의 사유로 더 이상의 서비스 제공이 불가능할 경우 \\n 3. 회사는 제1항 또는 제2항에 따른 서비스의 변경, 제한, 중단으로 발생하는 문제에 대하여 회사의 고의 또는 중대한 과실이 없는 한 어떠한 책임도 지지 않습니다. \\n \\n 제8조(서비스 수수료) \\n 1. 회원은 회사가 제공하는 서비스를 이용하는 경우 이용 수수료 표에 기재된 수수료를 지급해야 합니다. 서비스 이용 수수료는 회원의 서비스 화면에 명시되어 있습니다. \\n <서비스 이용 수수료> \\n - 수수료명: 블록체인 이용료(gas fee) \\n - 수수료(율): 상시 변경 \\n - 수수료 지급 시점: 블록체인 상 트랜잭션 발생 시\\n \\n 제9조 (반품/교환/환불/취소) \\n 1. NFT 상품에 대한 반품/교환/환불/취소 \\n 가. 복구 불가한 블록체인 특성상 회원은 NFT 상품에 대한 반품, 교환, 환불 및 구매 취소를 할 수 없습니다. \\n 2. ARTE HOME 실물 상품에 대한 반품/교환/환불/취소 \\n 가. NFT를 받기 전 또는 NFT 가 민팅 되기 전 NFT와 별도로 구매한 실물 상품을 반품하거나 교환하고자 하는 경우, ‘전자상거래 등에서의 소비자보호에 관한 법률’ 제17조에 따라7일 이내에 회사를 통해 반품 또는 교환을 요청할 수 있습니다. 다만, 다음 각 호의 경우에는 구매자는 반품이나 교환을 요청할 수 없습니다. \\n 1. 실물 상품에 대응하는 NFT가 이미 거래된 경우 또는 유저가 NFT를 받은 경우 \\n 2. 구매자의 귀책사유로 상품이 훼손된 경우 \\n 3. 구매자의 사용 또는 일부 소비로 말미암아 실물 상품의 가치가 현저히 감소한 경우 \\n 4. 시간이 지나 재판매가 어려울 정도로 실물 상품의 가치가 현저히 감소한 경우 \\n 5. 복제가 가능한 실물 상품의 포장을 훼손한 경우 \\n 6. 기타 구매자가 환불이나 교환을 요청할 수 없는 합리적인 사유가 있는 경우 \\n 나. 반품을 신청할 때 반품송장번호를 기재하지 않으면 반품처리와 환불이 지연될 수 있습니다. \\n 다. 교환신청 시 만일 교환할 물품의 재고가 없을 경우 교환에 시일이 소요될 수 있습니다. \\n 라. 교환에 드는 비용은 물품하자의 경우에는 판매자가 왕복배송비를 부담하나 구매자의 변심에 의한 경우에는 구매자가 부담합니다. \\n 마. 회사는 구매자의 교환 또는 반품의 요청이 정당하지 않다고 판단하면 구매자의 의사표시를 취소할 수 있습니다. 또한, 구매자의 교환, 반품 등이 접수된 날로부터 14일이 지날 때까지 이미 수령한 상품을 판매자에게 반환하지 않거나 전화, 이메일(E-mail) 등으로 연락되지 않으면 교환, 반품의 의사를 철회한 것으로 간주할 수 있습니다. \\n 바. 확인된 거래가 취소되어 결제대금을 환불할 경우는 회사는 거래가 취소된 날로부터 2영업일 이내에 구매자에게 환불에 필요한 조치를 합니다. 신용카드로 결제했을 때는 환불을 요청한 즉시 결제 승인이 취소되고, 기타 수단으로 결제한 거래가 취소되었을 때에는 일반적인 환불 절차에 따라 진행됩니다. 환불 및 취소 방법은 결제 수단에 따라 다를 수 있으며, 자세한 사항은 서비스 내 HELP CENTER를 통해 공지합니다. \\n 사. 카드결제로 구매한 건의 환불은 카드결제 취소를 통해서만 가능하며, 현금으로 환불되지 않습니다. \\n 아. 회원은 상품이 발송되기 전에는 홈페이지를 통해 구매를 취소할 수 있으며, 배송 중이면 취소가 아닌 반품절차에 의해 처리됩니다. \\n 자. 배송준비 중 상태에서는 즉시 취소처리가 완료되는 것이 원칙이나 이미 상품이 발송되었다면 발송된 상품의 왕복 배송비는 구매자가 부담해야 합니다.\\n \\n 제10조 (회원 정보의 변경) \\n 1. 회원은 서비스를 통하여 언제든지 본인의 정보를 열람하고 수정할 수 있습니다. 다만, 서비스 관리를 위해 ARTE NFT가 제한한 정보는 수정할 수 없습니다. \\n 2. 회원은 서비스 이용 시 기재한 사항이 변경되었을 경우 서비스에서 직접 수정하거나 문의 메일을 통하여 회사에 변경 사항을 통지하여야 합니다. \\n 3. 회원이 전항의 변경 사항을 회사에 통지하지 않아 발생한 불이익에 대하여 회사는 책임을 지지 않습니다. \\n \\n 제11조 (회원 정보의 관리) \\n 1. 회사는 회원이 등록한 가상지갑 등이 회사에 등록된 것과 일치할 경우에는 별도의 확인 절차 없이 이용자를 회원으로 간주합니다. \\n 2. 회원은 본인의 허가를 받지 않은 제3자가 회원의 계정에 무단으로 접근하지 않도록, 계정 접근을 위해 필요한 일체의 정보를 안전하게 보관할 책임이 있습니다. \\n 3. 회원은 계정 접근 정보를 분실했거나, 도용 당했거나, 제3자에게 공개되었음을 인지한 경우 이를 즉시 회사에 통지해야 합니다. 회사는 즉시 계정 이용 중단 등의 조처를 할 수 있습니다. \\n 4. 회원의 가상 지갑 등 접근 정보가 분실, 도용 혹은 공개되어 회원에게 발생한 손해에 대하여 회사는 책임을 부담하지 아니합니다. 다만, 회사의 고의 또는 과실에 의한 경우에는 그러하지 아니합니다. \\n \\n 제12조 (권리의 귀속) \\n 1. 회사가 회원에게 제공하는 서비스에 대한 지식 재산권을 포함한 일체의 권리는 회사에 귀속됩니다. \\n 2. 회원은 서비스를 이용함으로써 얻은 정보를 회사의 사전 승낙 없이 복제, 송신, 출판, 배포, 방송 기타 방법에 의하여 영리 목적으로 이용하거나 제3자에게 이용하게 하여서는 안됩니다. \\n 3. 회사는 서비스와 관련하여 회원에게 회사가 정한 이용조건에 따라 서비스를 이용할 수 있는 이용권만을 부여하며, 회원은 이를 양도, 판매, 담보 제공 등의 처분행위를 할 수 없습니다. \\n \\n 제13조 (개인정보의 보호) \\n 회사는 정보통신망 이용 촉진 및 정보보호 등에 관한 법률, 개인정보 보호법 등 관련 법령이 정하는 바에 따라 회원의 개인정보를 최소한으로 수집하며 수집된 정보는 보호하기 위해 노력합니다. 개인정보의 보호 및 이용에 대해서는 관련 법령 및 회사의 개인정보처리 방침이 적용됩니다. 다만, 회사가 제작하여 제공한 화면 이외의 외부로 링크된 화면 등에서는 회사의 개인정보처리 방침이 적용되지 않습니다. \\n \\n 제14조 (회사의 의무) \\n 1. 회사는 관련 법령과 이 약관을 준수하며, 계속적이고 안정적으로 서비스를 제공하기 위하여 최선을 다하여 노력합니다. \\n 2. 회사는 회원이 안전하게 서비스를 사용할 수 있도록 개인정보 (신용정보 포함) 보호를 위해 보안 시스템을 갖출 수 있으며, 개인정보처리 방침을 공시하고 준수합니다. \\n 3. 회사는 서비스 이용과 관련하여 회원으로부터 제기된 의견이나 불만이 정당하다고 인정할 경우에는 이를 처리하여야 하며, 전자우편을 통하여 회원에게 처리 과정 및 결과를 전달할 수 있습니다. \\n \\n 제15조 (회원의 의무) \\n 1. 회원은 아래의 행위를 하여서는 안 됩니다. \\n 가. 타인의 정보 도용 \\n 나. 회사가 게시한 정보의 변경 \\n 다. 회사가 정한 정보 이외의 정보(컴퓨터 프로그램 등) 등의 송신 또는 게시 \\n 라. 회사의 저작권 등 지적 재산권에 대한 침해 \\n 마. 회사 및 기타 제3자의 명예를 손상하거나 업무를 방해하는 행위 \\n 바. 회사의 사전 동의 없이 영리를 목적으로 서비스를 사용하는 행위 \\n 사. 부정한 방법을 통하여 서비스에 접속하는 행위, 노출 횟수 및 클릭 횟수를 부정하게 생성하거나 증가시키는 행위, 서비스 이용 신청을 하는 행위, 회사의 서버에 부하를 일으키는 행위 \\n 아. 다른 회원의 개인정보 및 계정 정보를 수집하는 행위 \\n 자. 기타 불법적이거나 부당한 행위 \\n 2. 회원은 관계 법령, 이용약관 및 서비스와 관련하여 회사가 공지하거나 통지한 사항 등을 준수하여야 하며, 기타 회사의 업무에 방해되는 행위를 하여서는 안 됩니다. \\n \\n 제16조 (이용 방법의 제한) \\n 1. 회원이 회사 저작권을 침해하여 발생하여 회사 손해가 발생한 경우 본인의 책임과 비용으로 이를 해결하여야 하며, 회사는 이에 대하여 어떠한 당사자에게도 책임을 부담하지 않습니다. \\n 2. 회원은 회사의 초상권, 저작권 등 지적 재산권 및 기타 권리를 침해하는 목적으로 서비스를 이용할 수 없으며, 회사의 권리를 침해하는 행위로 인하여 발생하는 결과에 대한 모든 책임은 회원 본인에게 있습니다. \\n 3. 회원은 회사의 저작물을 무단으로 상업적이거나 기타 개인적인 이익을 위한 용도로 사용할 수 없습니다. \\n \\n 제17조 (이용의 중단) \\n 1. 회원은 언제든지 가상 지갑 연결 해지를 통해 이용을 중단하실 수 있습니다. \\n 2. 회사는 회원에게 다음과 같은 사유가 발생할 경우 시간을 정하여 서비스 이용을 제한함과 동시에 시정 요구를 할 수 있습니다. 시정 요구에도 불구하고 상당한 기간 내에 시정되지 않거나 2회 이상 반복적으로 같은 위반행위를 하는 경우에는 이용을 중단할 수 있습니다. \\n 가. 본 약관 제15조에 규정된 회원의 의무를 위반하거나 제16조에 규정된 이용 제한 사유에 해당하는 경우 \\n 나. 저작권법을 위반한 불법 프로그램의 제공 및 운영 방해, 정보통신망 이용 촉진 및 정보보호 등에 관한 법률을 위반한 불법 통신 및 해킹, 악성 프로그램의 배포, 접속 권한 초과 행위 등과 같이 관련 법령을 위반한 경우 \\n 다. 회사가 제공하는 서비스의 원활한 진행을 방해하는 행위를 하거나 시도한 경우 \\n 라. 그 밖에 각호에 준하는 사유가 발생한 경우 및 회사가 이용계약을 유지하는 것이 적절하지 않다고 판단하는 경우 \\n 3. 전 항에 따른 이용 중단 시 서비스 이용을 통해 획득한 모든 혜택이 소멸하며, 회사는 이에 대해 별도로 보상하지 않습니다. \\n 4. 이용 중단이 완료되는 경우 관련 법령 및 개인정보처리 방침에 따라 회사가 보유하여야 하는 정보를 제외한 회원의 모든 정보가 삭제됩니다. \\n 5. 전 항에도 불구하고 제2항에 따라 회사가 이용을 중단하는 경우 회사는 회원의 이의신청 접수 및 처리 등을 위하여 일정 기간 회원의 정보를 보관할 수 있으며, 해당 기간이 지난 후에 회원의 정보를 삭제합니다. \\n \\n 제18조 (책임 제한) \\n 1. 회사 또는 회원은 본 약관을 위반하여 상대방에게 손해를 입힌 경우에는 그 손해를 배상할 책임이 있습니다. 다만, 행위자의 고의 또는 과실이 없는 경우에는 그러하지 아니합니다. \\n 2. 다음과 같은 사유로 회원에게 손해가 발생하였을 경우, 회사가 회원의 손해 발생을 방지하기 위하여 필요한 관리자의 주의를 다하였음을 입증한 때에는 그 손해에 대하여 책임을 지지 아니합니다. \\n 가. 전시, 사변, 천재지변, 또는 이에 준하는 국가 비상사태 등의 경우 \\n 나. 정부 기관의 사실상 또는 법률상 행정처분 및 명령 등에 대한 준수로 인한 경우 \\n 다. 전기통신사업법에 의한 기간 통신 사업자를 포함한 통신서비스 업체의 서비스 장애로 인한 경우 \\n 라. 회사가 관리할 수 없는 외주 시스템 및 제휴 서비스의 하자 또는 이용자 측 귀책사유로 인하여 서비스에 장애가 발생한 경우 \\n 마. 순간적인 서비스 접속 증가 등으로 인한 서버의 장애가 발생한 경우 \\n 바. 서비스 내 저작물 등록시스템, NFT 저작물 조회를 위한 네트워크 장애 또는 오류가 발생한 경우 \\n \\n 제19조 (준거법 및 재판관할) \\n 1. 회사와 회원 간 발생한 분쟁에 대하여는 대한민국 법을 준거법으로 합니다. \\n 2. 회사와 회원 간 발생한 분쟁에 관한 소송의 관할법원은 서울중앙지방법원으로 합니다. \\n \\n \\n \\n- 시행 일자 : 2023년 6월 1일","en":"Article 1. Introduction\\nThe purpose of the Terms of Service (“Terms”) is to prescribe the rights, obligations, and responsibilities of the company and its users in using ARTE NFT services (“Services”) provided by a’strict Studio Co., Ltd. (“Company”)\\n\\nArticle 2. Definitions\\nThe definitions of terms used in these “Terms” are as follows, and interpretations of undefined terms are in accordance with relevant laws and regulations, the Company’s Terms and Conditions, Privacy Policy, and guidelines separately set by the Company.\\n1. “Services” refers to various services provided by the Company via websites and mobile forms.\\n2. “User(s)” refers to clients who are using the “Service” provided by the Company after having accessed the “Service” and have agreed to these Terms of Services.\\n3. “Account” refers to the blockchain wallet address inserted by the user after having agreed to these Terms of Services.\\n4. “NFT,” which stands for Non-Fungible Token, refers to (i) “digital works,” such as images, videos, music, books, etc., that contain metadata, (ii) a blockchain-based digital asset that grants owners specific rights (“NFT Owner’s Rights”) to the above “digital works.”\\n5. “Digital works” refer to digital artworks, such as digital images, videos, music, books, etc., related to NFT.\\n6. “Crypto Wallet” refers to the third-party blockchain wallet based on the Ethereum blockchain, provided by the Crypto Wallet service, MetaMask.\\n7. “Smart Contract” refers to a collection of code written in a language that contains general information, including the creation and sale of NFT works operating on the Ethereum mainnet environment, the blockchain network for ARTE NFT.\\n8. “NFT Owner’s Rights” refer to the rights notified at the time NFT is first sold at ARTE NFT. \\"NFT Owner\'s Rights\\" means the right to use \\"digital works\\" linked to NFT within a certain limit and does not mean acquiring ownership of intellectual property rights, copyrights or other rights of the \\"digital works\\" itself. The content of \\"NFT Owner\'s Rights\\" may differ for each NFT.\\n9. “ARTE NFT” refers to the service that uses artworks from ARTE MUSEUM by a’strict Studio Co., Ltd., for the sales of NFT products in a digital form.\\n10. \\"ARTE HOME\\" refers to the service that allows the User who owns ARTE NFT to purchase physical goods, such as art frames, digital displays, rather than digital files.\\n\\nArticle 3. Initiation and Revision of the Terms\\n1. The Company will post the Terms of Services on the startup page so that users can easily notice them\\n2. The Company may modify these Terms of Services, provided that such modifications will only be made to the extent they do not violate any applicable laws.\\n \\nArticle 4. Interpretation of the Terms\\n1. The Company may have additional terms and conditions, or operation policies other than these Terms of Service.\\n2. The additional provisions on the webpage shall prevail for matters not stipulated in these Terms of Service.\\n \\nArticle 5. NFT Owner\'s Rights\\n 1. When purchasing or otherwise accepting ownership of an NFT, Users acquire all right, title, and interest in and to the NFT, including, the right to sell, transfer, assign, donate, or otherwise dispose of ownership of the NFT, subject to the terms and conditions of this Agreement (hereafter “NFT Owner’s Rights”). Users do not gain any right, title, or interest in or to any of the artwork, images, music, audiovisual works, or other content associated with, or represented by, the NFT (hereafter collectively “Artwork”). Users’ rights to use the Artwork are subject to the terms and conditions of this Agreement, including Article 5 Section 2. \\n2. All right, title, and interest in and to the Artwork and the following is hereby expressly reserved for the Company, including Company’s rights in accordance with the applicable laws: (a) trademarks, service marks, trade dress, trade names, logos, domain names; (b) copyrights, and all other rights relating to works of authorship (whether copyrightable or not), including computer programs, and rights in data and databases; (c) industrial design rights; (d) rights of publicity; and (e) all other intellectual property and proprietary rights of any kind, in each case whether registered or unregistered, and including all registrations and applications for, and right to renewal or extend, such rights (hereafter collectively “Company\'s IP). Users may non-exclusively and non-commercially use the Company’s IP, and Users hereby acknowledge and agree to do nothing inconsistent with the Company\'s IP hereunder and shall not use Users’ IP other than pursuant to the terms and conditions of this Agreement, including the licenses granted in hereunder. (hereafter “License Grant and Restrictions”). Company retains the sole and exclusive right to apply for and own any registrations in and to Company\'s IP (and any components of Company\'s IP) and to bring any infringement, misappropriation, or unfair competition proceedings that involve Company\'s IP. If Users nevertheless acquire any rights in Company\'s IP, by legal proceeding or otherwise, Users hereby assign such rights to Company, without any further action required by any of the parties.\\n NFT owners are granted the right to license part of the copyright of digital works linked to NFT in accordance with the content of “NFT Owner’s Rights”. NFT in itself does not mean rights that include intellectual property rights, portrait rights, or commercialization rights, and holding NFT does not mean acquiring these rights to the linked digital works. \\n 3.  NFT owners are not authorized to modify the original digital works associated with NFT and may use the linked digital works in their original form only for personal and non-commercial use. \\n 4. “NFT Owner\'s Rights” may only be exercised while the NFT is legally held, and “NFT Owner\'s Rights” is recognized for the owner of the NFT at the time of exercising the rights. If the NFT is transferred to another person, the person who has transferred the NFT may no longer exercise the “NFT Owner’s Rights”. “NFT Owner\'s Rights” may not be guaranteed to anyone who has been transferred the NFT in a manner other than that officially supported by the “Company” and/or in violation of the relevant statutes.\\n\\nArticle 6. Use of NFT Service\\n1.  ARTE NFT Service is a service provided in conjunction with the Metamask Wallet Service, and can only be used by users, who have registered to the Metamask Wallet. By the wallet in connection with ARTE NFT Service, User agrees that he or she is using the wallet under the terms and conditions of the provider of the wallet (Metamask). Wallets are not operated by, maintained by, or affiliated with ARTE NFT, and ARTE NFT does not have custody or control over the contents of User’s wallet and has no ability to retrieve or transfer its contents. The provisions of this article describe the contents and limitations of the NFT Transaction Service. Users must fully understand the matters announced by the Company in advance before using the Service. As long as the problems do not occur due to the willful misconduct or negligence of the Company, the Company shall not be liable for any problems arising from the users’ insufficient understanding with the relevant matters.\\n 2. NFT Purchasing Service\\nA. In the case when a single ARTE NFT product is wanted by two Users at the same time, it will be claimed by the User who applied for the purchase first. \\nB. Once a transaction made by the User is complete, it cannot be withdrawn. This is the same for purchases made at the fault of the user. \\n 3. NFT Transaction Service\\n A. For NFT transactions, the Company provides services related to the receipt and temporary storage of NFT, as well as Korean currency payment service and digital asset payment service. \\n B. The Korean currency payment service within the Service refers to credit card payments, cash transfers, mobile payments and gift card payments among the payment services provided by Danal Co, Ltd., while the digital asset payment service refers to the cryptocurrency, Ethereum.\\n C. As the Company solely supports the execution of NFT transactions and Korean currency transactions made in accordance to the transaction amount under the conditions set by the user, the Company is not acting on behalf of the User nor assisting in the implementation of the transaction. In addition, with regards to digital asset payment and simple payment systems, the Company has no authority over these services and these are not provided by the Company as a payment system service provider.\\n D. When making Korean currency transactions, the user must be aware of the Korean Won and virtual currency exchange rate table on the transaction screen, be fully aware of the liquidity of the purchase price before participating in the transaction.\\n E. When making Korean currency transactions, users must only use the payment method under their own name and must not use the payment method of others arbitrarily. The user will be responsible for the loss and damage of the company, the legitimate owner of the payment method, and any third-party related to the payment caused by the arbitrary or wrongful use of another person’s payment method.\\n F. The user shall bear fully responsibilities and disadvantages incurred in connection with the information entered by the user for the transactions.\\n G. The Company may check the details to the user’s legal rights to use the payment method submitted by the user, and can stop the transaction or cancel the transaction until the confirmation is complete.\\n H. The Company is not responsible for any transactions that are made by any other payment services provided by the Company.\\n\\nArticle 7. Modifications and Restrictions to the Service\\n1. The Company reserves the right in our sole discretion to modify all or part of the Service at any time for the improvement of the Service.\\n2. The Company may restrict or suspend all or part of the Services in any of the following cases:\\nA. In the cases of maintenance, inspection, replacement or failure or malfunctions of computers, information and communications infrastructure.\\nB. In unavoidable cases, due to construction or repairs of facilities or infrastructure for Service.\\nC. In cases where the normal use of Service is hindered by a power outage, infrastructure malfunction, or congestion in the service use.\\nD. In cases where a user interferes with business operations of the Company.\\nE. In cases where the Service can no longer be maintained due to various circumstances of the Company, such as a termination of contract with a service provider, management judgment or etc.\\nF. In cases due to force majeure events, such as nature disaster, state of national emergency or etc.\\nG. In cases where it is possible to provide further Service due to changes in Company’s business plans or management reasons.\\n3. The Company shall not be liable for any problems arising from the change, restriction, or suspension of services under paragraph (1) or (2), unless there were any willful misconduct or negligence of the Company.\\n\\nArticle 8. Service Fees\\n1. Users shall pay the fee listed below when using Services provided by the Company.\\n<Service Fee >\\nFee: Blockchain transaction fee (gas fee)\\nRate: Subject to change\\nTime of Service Fee Charged: When there is a transaction on blockchain\\n \\nArticle 9. Return/Exchange/Refund/Cancellation\\n 1. Return/Exchange/Refund/Cancellation of NFT\\n Due to the nature of ARTE NFT Service, which includes non-recoverable blockchain technology, users cannot cancel purchased products.\\n 2. Return/Exchange/Refund/Cancellation of ARTE HOME physical products \\nA. If the User wishes to return or exchange a physical product purchased separately from NFT or prior to receiving NFT, or before NFT has been minted, the User may request return orexchange through the Company within 7 days, in accordance with Article 17 of the “Act on Consumer Protection in Electronic Commerce, etc.” However, the User cannot request a return orexchange in the following cases: \\n1. In cases in which the digital twin NFT of the physical product has already been minted or has been received by the User. \\n2. In cases in which the product is lost or damaged due to reasons attributable to the User. \\n 3. In cases in which the value of the physical product has significantly decreased due to the User’s use or partial consumption. \\n4. If the value of the physical product has significantly decreased over time to the extent that resale is difficult. \\n5. If the packaging of a duplicable physical product has been damaged. \\n6. If there are reasonable grounds for the User not being able to request a refund or exchange. \\nB. If the return tracking number is not provided when applying for a return, the return process and refund may be delayed. \\nC. If the item to be exchanged is out of stock, it may take time to process the exchange. \\nD. The cost of exchange shall be borne by User in case of change of mind, while the provider shall bear the round-trip shipping costs in case of defective product. \\nE. If the company deems User’s exchange or return request unjustified, it may cancel User’s expression if intention. In addition, if User does not return the received product to Companyor contact them by phone, email, etc. within 14 days from the date of receipt of the exchange or return request, it may be considered as a withdrawal of intention for exchange or return.\\nF. If a confirmed transaction is canceled and a refund is required, the company will take necessary measures to complete the refund within 2 business days from the date of cancellation.If paid by credit card, the approval will be canceled immediately upon request for a refund. For other payment methods, it will be processed according to the general refund procedure.Refund and cancellation methods may vary depending on the payment method, and details will be announced through the HELP CENTER within the service. \\nG. Refunds for purchases made by credit card can only be made through credit card cancellation and cannot be refunded in cash. \\nH. Users can cancel their purchase through the website before the product is shipped, but if the product has already been shipped, it will be processed through the return process, notcancellation. \\nI. In principle, cancellation process is completed immediately in the preparation for shipping state, but if the product has already been shipped, such User shall bear the round-trip shipping costs for the shipped product. \\n\\nArticle 10. Change of User Information\\n1.  Users can always access and modify their information through the Service. However, restricted information for service management cannot be modified.\\n2.  The user shall notify the Company of the change by modifying it directly on the Service or by submitting an inquiry via email.\\n3.  The Company shall not be responsible for any disadvantages arising from the user’s failure to notify the Company of the changes in the preceding paragraph.\\n \\nArticle 11. Management of User Information\\n1. The Company considers the user as a registered user without further verification procedure if the virtual wallet registered by the user matches the one registered with the Company.\\n2. The User is responsible for keeping all necessary information for the account safely so that no Third-Parties can access the user’s account without permission.\\n3. The User shall immediately notify the company for the loss, theft or disclosure of account information to a Third Party. The Company can immediately suspend the use of the account.\\n4. The Company is not responsible for any damage caused to the User due to the loss, theft, or disclosure of user’s access information, such as the user’s virtual wallet. However, this is not applicable in the case of misconduct or negligence of the Company. \\n \\nArticle 12. Attribution of Rights\\n1. All rights, including intellectual property rights to the Services provided by the Company to Users, belong to the Company.\\n2. The User shall not use the information obtained by using the Service for profit or use it to a Third Party by means of reproduction, transmission, publication, distribution, broadcasting, or other means without the prior consent of the Company\\n3. With regards to the Service, the Company grants Users only the right to use the Service according to the conditions of use set by the Company, and the User shall not dispose of the right in ways of transferring, selling or providing collateral.\\n\\nArticle 13. Protection of Private Information\\nThe Company collects Users’ personal information to a minimum and strives to protect the collected information as prescribed by relevant laws and regulations, including Act on Promotion of Information and Communications Network Utilization and Personal Information Protection Act. Laws related to personal information protection and the use of personal information applies to the Company’s Privacy Policy. However, the Company’s Privacy Policy does not apply to those that are not produced and provided by the Company or to the screens linked to Third-Party websites.\\n \\nArticle 14. Obligations of the Company\\n1. The Company complies with the relevant laws and these Terms of Services, and strives to continuously provide Services in a stable manner.\\n2. The Company establishes a security system for private information protection, discloses and complies with the Privacy Policy, in order to provide the Service in a secure manner, where Users can safely use the Service.\\n3. If the Company deems that an opinion or complaint raised by a User regarding the use of the Service is justified, it shall handle it and deliver the process and results to the User via email.\\n \\nArticle 15. Obligations of the User\\n1.   User shall refrain from doing the following actions:\\nA. Stealing information from others\\nB. Changing information posted by the Company\\nC. Transmitting or posting of information other than the information determined by the Computer (i.e. computer programs)\\nD. Infringing on Intellectual Property Rights, such as copyrights of the Company\\nE. Damaging the reputation of the Company and other Third Parties or interfering with the business\\nF. Using Services in a commercial way without prior consent of the Company.\\nG. Accessing Service through illegal methods, illegally generating or increasing the number of exposures and clicks, or illegally applying for Service use, and causing a burden on Company’s server\\nH. Collecting other users’ personal information or account information\\nI. Other illegal or unjustified actions\\n2. User shall comply with matters notified by the Company in relation to relevant laws, and Terms of Service and shall not engage in any other acts that interfere with the Company’s work.\\n \\nArticle 16. Restrictions on Usage\\n1.If the User violates the Company’s copyright and causes damages to the Company, the User shall resolve it as his or her own responsibility and expense, and the Company shall not bear any responsibility.\\n2.The User cannot use the Service for the purpose of infringing on the rights of the Company, including Intellectual Property Rights, portrait rights and copyrights of the Company and the User will be responsible for the consequences of the infringements.\\n3. The User shall not use the Company’s works without permission for commercial or other personal gain.\\n\\nArticle 17. Termination of Usage\\n1. The User can terminate the Service at any time by disconnecting the virtual wallet.\\n2. The Company may set a restriction for a certain time frame and request correction for the following reasons. In spite of the request for correction, the User’s Service can be terminated if not corrected within a considerable period or if the same violation is repeated more than twice.\\nA. In cases where the User violates his or her obligations prescribed in Article 15 or falls under the grounds for restriction of use prescribed in Article 16.\\nB. In cases of providing illegal programs, hacking, distribution of malicious programs and exceeding access rights, etc., in violation of relevant laws and regulations such as the Act on Provision and Operation of Illegal Programs, Promotion of Information and Communication Network Utilization, etc.\\nC. In cases of acting or attempting to interfere with the smooth progress of the Services provided by the Company\\nD. In cases of any other reasons corresponding to each subparagraph occurs and the Company deems inappropriate to maintain the User’s Service.\\n3. In the event of Service termination pursuant to the preceding paragraph, all benefits obtained through the use of the Service will be terminated and the Company does not have to compensate for the loss.\\n4. Once the suspension of use is complete, all information of the User will be deleted except for the information that the Company must hold in accordance with the Privacy Policy and relevant laws.\\n5. Notwithstanding the preceding paragraph, if the Company terminates the Service pursuant to paragraph 2, the Company may keep the User’s information for a certain period of time to receive and process the User’s objections and delete the User’s information after the period.\\n\\nArticle 18. Limitations of Liability\\n1. The Company or the User shall be responsible for compensating the other party for damages in violation of these Terms of Services. However, this is not the case if there is no intention or negligence of the actor.\\n2. In the event of damage to a User due to the following reasons, the Company shall not be liable for the damage if proven that necessary action was taken to prevent the User’s damage.\\nA. In the case of wartime, incident, natural disaster, or equivalent national emergency, etc.\\nB. In the case compliant with administrative dispositions, orders by government agency or by law\\nC In the case of service failure of a communications service company, such as a key communication service provider, pursuant to the Telecommunications Business Act.\\nD. In the case of a Service failure due to defects in outsourcing system and affiliated services that cannot be managed by the Company or due to reasons attributable to the User.\\nE. In the case of a Server failure due to a sudden surge in server access, etc.\\nF. In the case of a network failure or error while inspecting NFT internal system\\n\\nArticle 19. Applicable Act and Jurisdiction\\n1. Any disputes arising between the Company and the User shall be governed by the laws of Republic of Korea.\\n2. The Seoul Central District Court shall be the competent court for litigation in disputes arising between the Company and the User.\\n \\n- Effective Date: June 01, 2023\\n"},"termsPrivacy":{"topArea":{"ko":"㈜에이스트릭트스튜디오(이하 ‘회사’)는 이용자의 개인정보 보호를 매우 중요하게생각하며, 이용자가 회사의 서비스 (NFT판매 및 이와 관련된 제반 서비스)를이용하기 위해 회사에 제공한 개인정보 보호에 최선을 다하고 있습니다. 이에회사는 “개인정보 보호법” 등 개인정보 보호와 관련된 법령을 준수하고있습니다. 본 개인정보처리 방침은 관계 법령 및 회사의 내부 방침에 따라변경될 수 있으며, 개정 시 버전 관리를 통하여 개정사항을 쉽게 확인할 수있도록 하고 있습니다.  \\n\\n제1조 (개인정보 수집 항목 및 이용 목적)\\n회사가 제공하는 서비스는 개인정보를 수집하는 회원가입 절차 없이 콘텐츠에접근할 수 있습니다. 회사는 회원에게 다음 목적을 위해 이용자 개인정보를처리합니다. 처리하고 있는 개인정보는 다음의 목적 이외의 용도로는 이용되지않으며, 이용 목적이 변경되는 경우에는 개인정보 보호법 제18조에 따라 별도의동의를 받는 등 필요한 조치를 이행할 예정입니다.\\n1. 서비스 사용 신청 시 가상 지갑 주소만 필수 항목으로 수집합니다.\\n2. 회원이 구매하는 상품 배송을 위해 이름, 휴대 전화 번호, 배송지, 이메일주소 등을 수집할 수 있습니다.\\n3. 신규 서비스 개발 및 맞춤 서비스 제공, 서비스의 유효성 확인, 이벤트 및광고성 정보 제공 및 참여 기회 제공을 위해 이름, 휴대전화 번호, 이메일 주소등을 수집할 수 있습니다.\\n4. 서비스를 이용하면서 이용 문의를 하거나, 권리 침해 신고를 접수하는경우에는 문의 접수 및 해결 과정에서 이메일 주소를 수집할 수 있습니다.\\n5. 이외에도 추가적으로 로그 정보, 서비스 이용 기록, 앱 설치 정보 등이수집될 수 있습니다.\\n\\n제2조 (개인정보의 수집 방법)\\n1. 서비스 이용 과정에서 이용자가 개인정보 수집에 관해 동의를 하고 직접정보를 입력하는 경우, 해당 개인정보를 수집합니다.\\n2. 고객센터를 통한 상담 과정에서 이메일을 통해 이용자의 개인정보가 수집될수 있습니다.\\n3. 회사와 제휴한 외부 기업이나 단체로부터 개인정보를 제공받을 수 있으며,이러한 경우에는 제휴사에서 이용자에게 개인정보 제3자 제공 동의를 받은 후수집합니다.\\n\\n제3조 (개인정보의 보유 및 이용 기간)\\n이용자의 개인정보는 원칙적으로 개인정보의 수집에 대한 이용 목적 달성 시지체 없이 파기합니다. 단, 다음의 정보에 대해서는 아래의 이유로 명시한 기간동안 보존합니다.\\n 1. 법령 기준에 따라 별도 보관하는 경우\\n가. 계약 또는 청약 철회 등에 관한 기록: 5년(전자상거래 등에서의 소비자보호에 관한 법률)\\n나. 대금 결제 및 재화 등의 공급에 관한 기록: 5년(전자상거래 등에서의소비자 보호에 관한 법률)\\n다. 소비자의 불만 또는 분쟁 처리에 관한 기록: 3년(전자상거래 등에서의소비자 보호에 관한 법률)\\n라. 세법이 규정하는 모든 거래에 관한 장부 및 증빙서류: 5년(국세기본법)\\n마. 표시/광고에 관한 기록: 6개월(전자상거래 등에서의 소비자 보호에 관한법률)\\n바. 전자금융 거래에 관한 기록: 5년 (전자금융거래법)\\n사. 서비스 방문 기록: 3개월(통신비밀보호법).\\n\\n제4조 (개인정보의 제3자 제공)\\n1. 회사는 이용자의 개인정보를 개인정보처리 방침 제1조(개인정보의 처리목적)에서 명시한 범위 내에서만 처리하며, 정보주체의 동의, 법률의 특별한규정이 있거나 법령상 의무를 준수하기 위해 불가피한 경우 등 개인정보 보호법제17조(개인정보 제공) 및 제18조(개인정보의 목적 외 이용·제공 제한)에해당하는 경우에만 개인정보를 제3자에게 제공합니다.\\n2. 회사는 다음과 같은 개인정보를 이용자의 사전 동의를 받아 제3자에게제공하고 있습니다. 제공받는 자는 제휴 서비스 특성 및 계약에 따라 공지 없이변경될 수 있습니다.","en":"a’strict Korea Co., Ltd. (hereinafter referred to as \\"Company\\") considers the protection of users\' personal information very important and is doing its best to protect the personal information provided to the company for the use of the Company\'s services (NFT sales and related services). Accordingly, the Company complies with laws and regulations related to personal information protection, such as the Personal Information Protection Act. This Privacy Policy can be changed in accordance with the relevant laws and the company\'s internal policy. When it is revised, the revision can be easily noticed through version management.\\nArticle 1. Collected Personal Information & Use of the Collected Personal Information\\nUsers may access the Company’s Services without any need to subscribe as members. The Company processes the User\'s personal information to the members for the following purposes. The personal information being processed will not be used for any other purposes, and if the purpose of use is changed, necessary measures will be implemented, such as obtaining separate consent under Article 18 of the Personal Information Protection Act.\\n1.   Only virtual wallet addresses are required to be collected when applying for Service use.\\n2.   User’s name, phone number, shipping address, email address and etc. may be collected for the shipment of the ordered products by the User.\\n3.   Names, phone numbers, email addresses, and etc. may be collected to provide new customized services, validation of current Service, opportunities to participate in event and advertising information.\\n4.   When User makes an inquiry while using the Service or to submit a report of infringement of rights, email address may be collected in the process of receiving and resolving the inquiry.\\n5.   Additional log information and service usage record may be collected.\\n \\nArticle 2. Method of Collecting Personal Information\\n1.   If the User agrees to providing personal information and enters the information voluntarily while using the Service, the relevant personal information is collected.\\n2.   The User’s personal information can be collected via email during consultation process through Customer Help Center.\\n3.   Personal Information can be provided by external companies or organizations affiliated with the Company, and in such case, personal information is collected after obtaining consent from the user from the affiliated company.\\n\\nArticle 3. Use and Retention of Personal Information\\nIn principle, User’s personal information is destroyed without delay once the purpose of its use has been achieved. However, for the following reasons, the personal information can be retained for the specified period:\\n1.  Where it is stored separately in accordance with legal standards.\\nA. Records on withdrawal of contracts or subscriptions: 5 years (Act on Consumer Protection in Electronic Commerce, etc.)\\nB.  Records on payment and supply of goods: 5 years (Act on Consumer Protection in Electronic Commerce, etc.).\\nC. Records on the handling of consumer complaints or disputes: 3 years (Act on Consumer Protection in Electronic Commerce, etc.).\\nD. Books and documentary evidence for all transactions prescribed by the tax law: 5 years (Basic National Tax Act)\\nE. Records on Labeling/Advertising: 6 months (Act on Consumer Protection in Electronic Commerce, etc.) bar.\\n   F. Records on Electronic Financial Transactions: Five Years (Electronic Financial Transactions Act)\\n   G. Service visit records: 3 months (Communication Secret Protection Act).\\n \\nArticle 4. Provision of Personal Information to Third Parties\\n1. The Company processes User\'s personal information only within the scope specified in Article 1 of the Personal Information Processing Policy and can provide personal information to third parties when it falls under Articles 17 (Provision of Personal Information) and 18 (Restriction of Use or Provision of Personal Information) or for special provision of the law, legal obligations and other inevitable cases.\\n2. The Company provides the following personal information to third parties with prior consent from Users. The recipient is subject to change without notice, depending on the nature of the affiliate service and the contract.\\n"},"midArea":{"ko":"제5조 (개인정보의 처리위탁) \\n 1. 회사는 서비스 제공에 있어 필요한 업무 중 일부를 외부 업체가 수행하도록 개인정보를 위탁하고 있습니다. 그리고 위탁 받은 업체가 관계 법령을 위반하지 않도록 관리·감독하고 있습니다. \\n 2. 회사는 다음과 같이 개인정보 처리 업무를 위탁하고 있습니다.","en":"Article 5. Consignment of Personal Information\\n1. The Company consigns personal information to external companies to perform some necessary tasks in order to provide the Service. The Company manages and supervises the consigned Company so that it does not violate any relevant laws and regulations. \\n2. The company consigns the following personal information.\\n"},"bottomArea":{"ko":"제6조 (개인정보의 파기) \\n 이용자의 개인정보는 원칙적으로 개인정보의 수집 및 이용 목적이 달성되면 지체 없이 파기합니다. 개인정보 파기 절차 및 방법은 다음과 같습니다. \\n 1. 파기 절차 \\n 가) 이용자가 회원가입 등을 위해 입력한 정보는 목적이 달성된 후 별도의 DB로 옮겨져(종이의 경우 별도의 서류함) 내부 방침 및 기타 관련 법령에 의한 정보보호 사유에 따라 (보유 및 이용 기간 참조) 일정 기간 저장된 후 파기됩니다. \\n 나) 개인정보는 법령에 의한 경우가 아니 고서는 보유되는 이외의 다른 목적으로 이용되지 않습니다. \\n 2. 파기 방법 \\n 가) 종이에 출력된 개인정보는 분쇄기로 분쇄하거나 소각을 통하여 파기합니다. \\n 나) 전자적 파일 형태로 저장된 개인정보는 기록을 재생할 수 없는 기술적 방법을 사용하여 삭제합니다. \\n \\n 제7조 (이용자 및 법정대리인의 권리와 그 행사 방법) \\n 1. 이용자는 언제든지 자신의 개인정보를 조회하거나 수정할 수 있으며 가입 해지를 요청할 수도 있습니다. \\n 2. 이용자가 개인정보의 오류에 대한 정정을 요청하신 경우에는 정정을 완료하기 전까지 당해 개인정보를 이용 또는 제공하지 않습니다. \\n 3. 또한, 잘못된 개인정보를 제삼자에게 이미 제공한 경우에는 정정 처리결과를 제삼자에게 바로 통지하여 정정이 이루어지도록 하겠습니다. \\n 4. ‘회사’는 이용자의 요청에 따라 해지 또는 삭제된 개인정보는 회사가 수집하는 개인정보의 보유 및 이용 기간에 명시된 바에 따라 처리하고 그 외의 용도로 열람 또는 이용할 수 없도록 처리하고 있습니다. \\n \\n 제8조 (개인정보 자동 수집 장치의 설치·운영 및 거부에 관한 사항) \\n ‘회사’는 이용자의 서비스 편의를 제공하기 위해 이용정보를 저장하고 수시로 불러오는 ‘쿠키(COOKIE)’를 사용합니다. 쿠키는 웹사이트가 고객의 컴퓨터 브라우저(인터넷 익스플로러 등)에 전송하는 소량의 정보입니다. \\n 1. 쿠키의 사용 목적 \\n 쿠키를 통해 이용자가 선호하는 설정 등을 저장하여 이용자에게 더욱 빠른 웹 환경을 지원하며, 편리한 이용을 위해 서비스 개선에 활용합니다. 이를 통해 이용자는 더욱 손쉽게 서비스를 이용할 수 있게 됩니다. \\n 2. 쿠키 설치·운영 및 거부 \\n 이용자는 쿠키 설치에 대한 선택권을 가지고 있으며, 언제든지 이러한 쿠키의 저장을 거부하거나 삭제할 수 있습니다. \\n 3. 쿠키 설정 거부 방법 \\n - Internet Explorer: 도구 메뉴 선택 &gt; 인터넷 옵션 선택 &gt; 개인정보 탭 클릭 &gt; 고급 개인정보 설정 &gt; 쿠키 수준 설정 \\n - Chrome : 설정 메뉴 선택 &gt; 고급 설정 표시 선택 &gt; 개인정보 및 보안 &gt; 쿠키 및 기타 사이트 데이터 &gt; 쿠키 수준 설정 \\n - Safari : 환경설정 메뉴 선택 &gt; 개인정보 탭 선택 &gt; 쿠키 및 웹사이트 데이터 수준 설정 단, 쿠키 설치를 거부하였을 경우 로그인이 필요한 일부 서비스 이용에 어려움이 있을 수 있습니다. \\n \\n 제9조 (개인정보의 기술적·관리적 보호 대책) \\n 회사는 개인정보의 안전성 확보를 위해 다음과 같은 조치를 취하고 있습니다. \\n 1. 관리적 조치: 내부 관리 계획 수립 시행, 정기적 직원 교육 등\\n 2. 기술적 조치: 개인정보 처리 시스템 등의 접근 권한 관리, 접근통제시스템 설치, 고유 식별 정보 등의 암호화, 보안 프로그램 설치 등\\n 3. 물리적 조치: 전산실, 자료 보관실 등의 접근 통제 \\n \\n 제10조 (개인정보 보호 책임자 및 연락처) \\n 회사는 아래와 같이 개인정보 보호 책임자를 지정하고 있으며, 개인정보 관련 문의 사항에 신속하고 성실하게 답변해 드리고 있습니다. \\n [개인정보 보호 책임자] \\n - 이름 : 최은석 \\n - 직위 : 부사장 \\n - 소속 : 경영진 \\n - 메일 : victor@dstrict.com \\n \\n 제11조 (권익침해 구제 방법) \\n 개인정보 침해에 대한 피해구제, 상담 등이 필요할 경우 다음 기관에 문의하실 수 있습니다. \\n - 개인정보침해신고센터(http://privacy.kisa.or.kr / 국번 없이 118) \\n - 개인정보분쟁조정위원회(http://kopico.go.kr / 국번 없이 1833-6972) \\n - 대검찰청 사이버수사과(http://cybercid.spo.go.kr / 국번 없이 1301) \\n - 경찰청 사이버안전국(http://cyberbureau.police.go.kr / 국번 없이 182). \\n 제12조 (링크 사이트에 대한 책임) \\n 회사는 이용자에게 다른 외부 사이트로 연결되는 링크를 제공할 수 있습니다. 이 경우 회사는 외부 사이트에 대한 통제권이 없으므로 이용자가 외부 사이트로부터 제공받은 서비스나 자료의 유용성, 진실성, 적법성에 대해 책임 및 보증할 수 없으며, 링크된 외부 사이트의 개인정보처리 방침은 회사와 무관하므로 해당 외부 사이트의 정책을 확인하시기 바랍니다. \\n \\n 제13조 (개인정보처리방침의 개정) \\n 본 개인정보처리 방침의 내용 추가, 삭제 및 수정이 있을 시에는 개정 최소 7일 전부터 홈페이지를 통해 변경 및 내용 등을 공지하도록 하겠습니다. \\n \\n \\n \\n - 공고 일자 : 2023년 5월 1일 \\n- 시행 일자 : 2023년 6월 1일","en":"Article 6. Destruction of Personal Information\\nIn principle, User\'s personal information is destroyed without delay once the purpose of collecting and using personal information has been achieved. The procedure and method of destroying personal information are as follows.\\n1.  Destruction procedure\\n   A) The information entered by the user for membership registration is transferred to a separate DB once the purpose has been achieved (in the case of paper, transferred to a separate document storage) and stored for a certain period of time according to the internal policy and other related laws.\\n   B) Personal information is not used for any other purposes other than the stated purpose, unless it is stored separately for legal standards.\\n2.  Method of Destruction\\n   A) Personal information printed on paper is destroyed by grinding or incineration\\n   B) Personal information stored in the form of an electronic file is deleted using a technical method that cannot be restored.\\n \\nArticle 7. Rights of Users and Legal Representatives and Exercising the Rights\\n1.  Users can view or update their personal information and request access to their personal information at any time.\\n2.  If User requests correction of errors in his/her personal information, the relevant personal information will not be used or provided until the correction is made.\\n3.  In the case where incorrect personal information has been provided to a third party, the Company will notify the third party of the corrected information without delay to ensure that the necessary correction is made.\\n4.  The Company processes personal information terminated or deleted at the request of User in pursuant to the Use and Retention of Personal Information and such personal information will not be accessible or available of any other purposes.\\n \\nArticle 8. Information about Automated Collection of Personal Information\\nThe Company uses ‘COOKIE’, which automatically stores usage information and brings it up to provide convenience for users. Cookies are small amounts of information that a website sends to a computer browser (such as Internet Explorer.\\n1.  Purpose of COOKIE\\nThrough Cookies, users can store their preferred settings to support a faster web environment and use them to improve services for convenient use.\\n2.  Installation, Operation and Refusal of Cookies\\nUsers have the option to install Cookies and can refuse or delete them at any time.\\n3.  How to Reject Cookie Settings\\n- Internet Explorer: Select Tools > Internet Options > Privacy > Advanced Privacy > Cookie Level Settings\\n- Chrome: Select Settings > Display Advanced Settings > Privacy > Cookie and Other Side Data > Cookie Level Settings\\n- Safari: Select Preferences > Privacy > Cookies and Web Site Data Settings\\nRefusing all cookies may bring difficulties in using some Services that require login.\\nArticle 9. Actions Taken to Protect Personal Information\\nThe Company is taking the following measures to protect personal information.\\n1.  Management Measures: implementation of internal management plans, regular employee training, etc.\\n2.  Technical Measures: Management of access rights for personal information processing systems, installation of access control systems, encryption of unique identification information, installation of security programs, etc.\\n3.  Physical Measures: Control access to computer rooms, data storage rooms, etc.\\n \\nArticle 10. Chief Privacy Officer\\nThe Company has designated the following person as the Chief Privacy Officer to remain responsible for responding to User inquiries regarding personal information and resolving any related complaints.\\n \\n[Chief Privacy Officer]\\n- Name : EUNSUK CHOE\\n- Position : Vice President\\n- Affiliation : Board of Directors\\n- Email : victor@dstrict.com\\n \\nArticle 11. Report or Consult on Infringements\\nIf User needs to report of consult on other privacy infringements, please contact the following institutions.\\n- Privacy Infringement Report Center (privacy.kisa.or.kr/Phone no.118)\\n- Personal Information Dispute Mediation Committee (http://kopico.go.kr / Phone no. 1833-6972)\\n- Cyber Crime Investigation Unit, Supreme Prosecutor’s Office (spo.go.kr/Phone no.1301)\\n- Cyber Bureau of Investigation, National Police Agency (police.go.kr/Phone no. 182)\\n \\nArticle 12. Liability for Link Sites\\nThe Company can provide users with links to other external sites. In this case, the Company does not have control over the external site, so cannot be responsible for the usefulness, authenticity, or legality of services or data provided by the external site to users. The privacy policy of the linked external site is irrelevant to the Company so please check the policy of the external site.\\n \\nArticle 13. Obligation to Notify Prior to Amendment\\nUsers will be notified of any addition, deletion, and/or modification in this Privacy Policy through the Website at least 7 days prior to the scheduled amendment.\\n\\n\\n- Notification Date: May 1, 2023\\n- Effective Date: June 1, 2023\\n"},"firstTable":{"titles":[{"ko":"제공받는 자","en":"Recipient"},{"ko":"제공목적","en":"Purpose of Provision"},{"ko":"제3자 제공항목","en":"Provided Information to Third-Party"},{"ko":"보유기간","en":"Retention Period"}],"contents":[[{"ko":"㈜프린트\\n베이커리","en":"Print Bakery\\nCo., Ltd."},{"ko":"상품 제작 \\n및 배송","en":"product production\\nand delivery"},{"ko":"이름, 휴대전화번호, 배송주소, 회원 소유의\\nNFT 디지털 자산 정보, 구매일시 및 가격","en":"ame, phone number, shipping\\ninformation, User’s NFT digital\\nasset information, Purchase date,\\nprice"},{"ko":"서비스 제공 목적\\n달성 시 까지","en":"Until the Service\\nis delivered"}],[{"ko":"㈜ 엘팩토리","en":"ELFACTORY Co., Ltd."},{"ko":"상품 제작 \\n및 배송","en":"product production\\nand delivery"},{"ko":"이름, 휴대전화번호, 배송주소, 회원 소유의\\nNFT 디지털 자산 정보, 구매일시 및 가격","en":"ame, phone number, shipping\\ninformation, User’s NFT digital\\nasset information, Purchase date,\\nprice"},{"ko":"서비스 제공 목적\\n달성 시 까지","en":"Until the Service\\nis delivered"}]]},"secondTable":{"titles":[{"ko":"수탁업체","en":"Consigned Company"},{"ko":"위탁 목적","en":"Purpose of Consignment"}],"contents":[{"company":{"ko":"카카오페이","en":"KakaoPay"},"purpose":{"ko":"원화 결제 서비스 제공","en":"Provision of Simple Payment Service"}},{"company":{"ko":"Amazon Web Services(AWS)","en":"Amazon Web Services(AWS)"},"purpose":{"ko":"클라우드 IT인프라 제공","en":"Provision of clouds, IT infrastructure"}},{"company":{"ko":"(주)스페이스리버\\n(주)스마트로\\n88더브레이브\\n휴맥스\\n다우디엔디","en":"SPACERIVER Co., Ltd.\\nSMARTRO Co., Ltd.\\n88TheBrave\\nHUMAX Co., Ltd\\nDAU D&D"},"purpose":{"ko":"일부 상품 직접 배송 서비스 및 서비스 플랫폼 제공","en":"delivery of partial products and delivery service platform"}}]}}}');

